fields.description:
В состав набора входит:
• цветная фотография готовой картины;
• высококачественные хлопковые нити - мулине «Anchor» английской фирмы Coats, намотанные в соответствии со значками на схеме таким способом, чтоб обеспечить удобный процесс работы и хранение мулине;
• канва, производства немецкой фирмы Zweigart.
• чёрно-белая счётная схема;
• иглу для вышивания;
• инструкцию на русском языке.
